import React from "react";
import {BrowserRouter} from "react-router-dom";
import {Button, Input, Card} from "antd";

class Case extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <BrowserRouter>
                <div style={{padding: "30px 20px"}}>
                    <Input.Group compact>
                        <Input style={{width: "200px"}} placeholder={"请输入案例名称"}/>&nbsp;&nbsp;&nbsp;
                        <Button type={"primary"}>搜索</Button>&nbsp;&nbsp;&nbsp;
                        <Button type={"添加"}>添加</Button>
                    </Input.Group>
                    <Card style={{marginTop: "20px"}} hoverable></Card>
                </div>
            </BrowserRouter>
        )
    }
}

export default Case;
